import React from 'react';

class Weather extends React.Component {
    render() {
        return (
            <div>
                {this.props.city && this.ptops.country && <p> Locaion: {this.props.city}, {this.props.country}
                </p>}

                {this.props.temperature && <p> Temperatur: {this.props.temperature}
                </p>}

                {this.props.humidity && <p> Humidity: {this.props.humidity}
                </p>}
                {this.props.condition && <p> Conditions: {this.props.description}
                </p>}


            </div>
        );
    }
}
;

export default Weather;
